var from=require("from"),through=require("../"),tape=require("tape");tape("simple async example",function(e){var n=0,t=[1,2,3,4,5],i=[];from(t).pipe(through(function(e){this.pause(),n++,setTimeout(function(){console.log("pushing data",e),this.push(e),this.resume()}.bind(this),300)})).pipe(through(function(e){console.log("pushing data second time",e),this.push(e)})).on("data",function(e){i.push(e)}).on("end",function(){e.deepEqual(i,t),e.end()})});